        return (
            <div className="card text-center">
                <img src={avatar_url} className="round-img" alt="" style={{width:"60px"}}/>
                <h3 >{login}</h3>
                <Link to={`/user/${login}`} className="btn btn-dark btn-sm my-1">More</Link>
            </div>
        )


}
UserItem.propTypes={
    user :PropTypes.object.isRequired,
}

